import Capa from '../imagens/menina.jpeg'
const Movie=(props)=>{return(
    <div>
        <p>{props.title}</p>
        <p>{props.descricao}</p>
        <p>{props.data}</p>
        <p><img src={Capa} alt="foto de capa"></img></p>
    </div>

)}
export default Movie
